// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Sidebar from './componentes-comunes/Sidebar'; // Asegúrate de que este import sea correcto
import Navbar from './componentes-comunes/Navbar';  // Si es necesario
import Footer from './componentes-comunes/Footer';  // Si es necesario
import Dashboard from './administrador/paginas/Dashboard'; // Página de prueba del Dashboard
import { SidebarAdminData } from './administrador/data/SidebarAdminData'; // Datos del Sidebar

const App = () => {
    return (
        <Router>
            <div className="app-container">
                {/* Sidebar con datos del admin */}
                <Sidebar data={SidebarAdminData} />

                <div className="main-content">
                    {/* Aquí puedes agregar un Navbar si es necesario */}
                    <Navbar />

                    {/* Rutas, pero solo vamos a mostrar el Dashboard por ahora */}
                    <Routes>
                        <Route path="/dashboard" element={<Dashboard />} />
                    </Routes>

                    {/* Pie de página si es necesario */}
                    <Footer />
                </div>
            </div>
        </Router>
    );
};

export default App;
